-- Check if the schema exists, if not, create it
DO
$$
BEGIN
    IF NOT EXISTS (
        SELECT 1
        FROM information_schema.schemata
        WHERE schema_name = 'stg'
    ) THEN
        CREATE SCHEMA stg;
    END IF;
END
$$;

