CREATE TABLE public.ecommerce_transaction (
	transaction_id int4 NULL,
	transaction_time information_schema."time_stamp" NULL,
	user_id int4 NULL,
	user_name varchar(50) NULL,
	user_email varchar(50) NULL,
	user_phone varchar(50) NULL,
	user_gender varchar(50) NULL,
	user_age int4 NULL,
	user_city varchar(50) NULL,
	store_id int4 NULL,
	store_name varchar(50) NULL,
	store_phone varchar(50) NULL,
	store_city varchar(50) NULL,
	product_id int4 NULL,
	product_name varchar(50) NULL,
	product_category varchar(50) NULL,
	product_price float4 NULL,
	quantity int4 NULL,
	total_price float4 NULL,
	payment_method varchar(50) NULL,
	transaction_status varchar(50) NULL,
	shipping_method varchar(50) NULL
);



